  };

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/register" element={<SignUp />} />
        <Route path="/shoppingCart" element={<ShoppingCart />}/>
        <Route path="/order" element={<OrderPage />}/>
        <Route path="/profile" element={<ProfilePage />}/>
